    "2014-09-17T18:30:12.041845",nt"name": "aerial-photography-and-imagery-ortho-corrected-2007-digital-orthophotos-fdem-lee-county",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is one component of the Florida
    Division of Emergency Management's (FDEM) Project Management and Technical Services
    for Mapping within Coastal Florida (Contract 07-HS-34-14-00-22-469), encompassing
    the entire coastline of Florida. The dataset is comprised of orthophoto imagery,
    which is a digital image (raster) map produced from aerial imagery that has been
    rectified to correct for aircraft tilt, terrain relief, and camera/sensor lens distortion.
    The resulting image has a consistent scale throughout, allowing the user to take
    direct measurements such as distances, angles, positions, and areas. In accordance
    with the Baseline Specifications 1.2, the imagery is delivered in GeoTIFF and MrSID
    formats based on the FDEM's 5,000' by 5,000' grid. Image resolution is 0.5-foot
    pixels. The digital elevation model (DEM) used for orthorectification was developed
    from new LiDAR data acquired by the Woolpert Team for the FDEM project. Both natural
    color and color infrared imagery were produced. The horizontal accuracy requirement
    is a verified 3.8 feet at the 95% confidence interval (2.2 feet RMSE) as specified
    in the FGDC Geospatial Positioning Accuracy Standards, Part 3: National Standard
    for Spatial Data Accuracy (http://www.fgdc.gov/standards/projects/FGDC-standards-projects/accuracy/part3/index_html).",nt"license_title":
